def mask_sequence(input_str):
    sequence = []
    mask_next = False
    masked_digit = '<masked_digit>'

    for char in input_str:
        if char == 'w':
            mask_next = True
        elif mask_next:
            sequence.append(masked_digit)
            mask_next = False
        else:
            sequence.append(char)

    return '<sequence_start>' + ''.join(sequence) + '<sequence_end>
